// import img7 from './Temp_distribution.png';
import './Home.css'


const Logo = () =>{
	return(
		<div className = 'ma100 mt0 center' >
			<Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 600, width: 600 }} >
 				<div className="Tilt-inner pa3">
 					<img style={{paddingTop: '10px', justifyContent: 'center'}} alt='flag' src={img1}/>
 				</div>
			</Tilt>
		</div>
	);
}

export default Logo
